import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import ReactDOM from 'react-dom';
import {Container , Row, Col} from 'react-bootstrap';  
import './Cities.css';
function Cities(){
    return(
        <div className="main">  
    <Container>  
        <br></br>
        <br></br>
    <Row >  
    <Col md={3}><img src={require('./chennai.jpg')} alt='logo' width={450} height={350}/></Col>
    <Col md={1}></Col>
    <Col md={4}><img src={require('./chennai.jpg')} alt='logo' width={450} height={350}/></Col>
    <Col md={4}><img src={require('./chennai.jpg')} alt='logo' width={450} height={350}/></Col>
    </Row>  
  </Container>  
    </div>  
    );
}
export default Cities;
